import "./footer.scss";

const Footer = () => (
  <div className="navbar navbar-expand navbar-dark bg-dark mb-4 footer">
    <p className="copyright">
      &copy; {new Date().getFullYear()} BitzPrice, Inc.
    </p>
  </div>
);

export default Footer;
